void yy_lex_identsdb_obj::yy_lex_do_action(
    int            yy_lex_action_index)
{

    switch (yy_lex_action_index) {

case(0): {
 yy_lex_rslt() = yy_ast_ptr(new INTEGER(this));
	} break;  // case 0

case(1): {
 yy_lex_rslt() = yy_ast_ptr(new KURZTEXT(this));
	} break;  // case 1

case(2): {
 ++yy_cur_lineno(); 
	} break;  // case 2

case(3): {
 yy_lex_rslt() = yy_ast_ptr(new LANGTEXT(this));
	} break;  // case 3

case(4): {
 yy_lex_rslt() = yy_ast_ptr(new HEXIDENT(this));
	} break;  // case 4

case(5): {
 yy_lex_rslt() = yy_ast_ptr(new HEXMCODE(this));
	} break;  // case 5

    default:

    // bad lexer act_code operand

#if yy_trace_after_error_ <= yy_trace_
        yy_lex_dmp(yy_this_inp_obj->yy_inp_cur_err(),
            "bad lexer opcode");
#endif /*yy_trace_after_error_ <= yy_trace_ */
        yy_err_report(400, yy_lex_action_index);    
        yy_lex_abort();
        return;

    }   // end switch

}   // yy_lex_identsdb_obj::yy_lex_do_action()


KURZTEXT::KURZTEXT(
    yy_lex_identsdb_obj *yy_this_lex_ptr)
    : yy_this_type(yy_this_lex_ptr->yy_lex_rdc())
{

      yy_this_string = new char[yy_this_lex_ptr->yy_lex_len() + 1];

      if (yy_this_string == NULL) {
          yy_err_report(406);
          yy_assert_fail("space unavailable from new", __FILE__, __LINE__);
          }

      memcpy(yy_this_string, yy_this_lex_ptr->yy_lex_token(), 
          yy_this_lex_ptr->yy_lex_len());

      yy_this_string[yy_this_lex_ptr->yy_lex_len()] = '\0';
	// fhrendes '/*' und abschlieendes '*/' entfernen
		int iLen = yy_this_lex_ptr->yy_lex_len();

			memmove (yy_this_string, yy_this_string+2, iLen-4);
			yy_this_string[iLen-4] = '\0';

			OemToAnsi (yy_this_string, yy_this_string);

		// alles bis zum Zeilenende ist der LANGTEXT
			yy_this_lex_ptr->StartLangText();
	
}   // constructor for token KURZTEXT

KURZTEXT::~KURZTEXT()
{
    if (yy_this_string != NULL) {
        delete [] yy_this_string;
        yy_this_string = NULL;
        }

}   // destructor for token KURZTEXT

void KURZTEXT::yy_dump(
    yy_err_ptr yy_this_err_obj,
    const char *yy_dump_title)
{

//  use the failsafe error object, if no error object to dump to

    if (yy_this_err_obj == NULL) {
        yy_this_err_obj = yy_err_failsafe_obj();
        }

//  output the title if one is specified

    if (yy_dump_title != NULL) {
        yy_this_err_obj->yy_err_printf("TITLE: %s\n", yy_dump_title);
        }

//  output the type of token being dumped

    yy_this_err_obj->yy_err_printf("dump of KURZTEXT token:  (type = %d).\"", yy_this_type);

//  output the string associated with the token

    if (yy_this_string != NULL) {
                yy_this_err_obj->yy_err_puts(yy_this_string);
        }

    yy_this_err_obj->yy_err_puts("\".\n");
}   // KURZTEXT::yy_dump()

